const Header = () => {
    return (
        <div>            
            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <div id="logo">로고</div>
                <button id="search">검색</button>
                </div>
            <hr />
        </div>
    )
}
export default Header;
